import React, { Component } from 'react';




class Nav extends Component {
  render() {
    return (


          <div>
              <a class="active" href="#home">Home</a>
  <a href="#news">News</a>
  <a href="#contact">Contact</a>
  <a href="#about">About</a>
          </div>

    );
  }
}

export default Nav;
